import React, { useEffect, useState } from "react";
import Navbar from "components/Navbars/AuthNavbar.js";
import Footer from "components/Footers/Footer";
import { getAllTournaments } from "service/ApiUser";

export default function MyTournaments() {
  const [tournaments, setTournaments] = useState([]);

  useEffect(() => {
    getAllTournaments()
      .then(res => setTournaments(res.data))
      .catch(console.error);
  }, []);

  return (
    <>
      <Navbar transparent />
      <main className="min-h-screen bg-blueGray-200 py-10">
        <div className="container mx-auto px-4 max-w-4xl">
          <h2 className="text-3xl font-bold mb-6 text-center">Mes Tournois</h2>
          <ul className="space-y-4">
            {tournaments.length === 0 ? (
              <p>Aucun tournoi trouv√©.</p>
            ) : (
              tournaments.map(t => (
                <li key={t.id} className="bg-white p-4 rounded shadow flex justify-between">
                  <span>{t.name}</span>
                  <span className="text-gray-600">{t.location}</span>
                </li>
              ))
            )}
          </ul>
        </div>
      </main>
      <Footer />
    </>
  );
}
